import React, { Component } from "react";
import Slider from "react-slick";
import ReactPlayer from 'react-player'
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';
// import "slick-carousel/slick/slick.css"; 
// import "slick-carousel/slick/slick-theme.css";
// import '../../static/css/_slick.css'
// import '../../static/css/_slickTheme.css'

export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      fade: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      className: 'slides',
      arrows: true
    }
    return (
      <div style={{ width: '80%',margin:'auto',marginTop:'100px' }}>
        <OwlCarousel
    className="owl-theme"
    loop
    margin={10}
    nav
>
    <div class="item"><h4>1</h4></div>
    <div class="item"><h4>2</h4></div>
    <div class="item"><h4>3</h4></div>
    <div class="item"><h4>4</h4></div>
    <div class="item"><h4>5</h4></div>
    <div class="item"><h4>6</h4></div>
    <div class="item"><h4>7</h4></div>
    <div class="item"><h4>8</h4></div>
    <div class="item"><h4>9</h4></div>
    <div class="item"><h4>10</h4></div>
    <div class="item"><h4>11</h4></div>
    <div class="item"><h4>12</h4></div>
</OwlCarousel>
        <Slider {...settings}>
          <div>
            <img width="100%" src="https://images.unsplash.com/photo-1509592149237-bc44977d96d0?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1051&q=80" alt="photo" />

          </div>
          <div>
            <img width="100%" src="https://images.unsplash.com/photo-1509592149237-bc44977d96d0?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1051&q=80" alt="photo" />
          </div>
        </Slider>
        <ReactPlayer className="videos" url={`../../static/videos/boxes/2.mp4`} playing={true} loop={true} volume={1}  />
      </div>
    );
  }
}
